import React, { Component } from "react";
import { NavLink } from "react-router-dom";

const MainNav = () => {
  return (
    <header>
      <h1>hhhh</h1>
      <nav>
        <ul>
          <li>
            <NavLink to="all-quotes">All Quotes</NavLink>
          </li>
          <li>
            <NavLink to="new-quote">New Quote</NavLink>
          </li>
        </ul>
      </nav>
    </header>
  );
};
export default MainNav;
